@Sean that's not how uwsgi works though. There isn't actually a module you can install. It's injected into the python environment while running a python app under uwsgi. That is the only way to detect whether it's running or not and the uwsgi import won't show up outside of uwsgi. http://uwsgi-docs.readthedocs.io/en/latest/PythonModule.html

